%[text] %[text:anchor:T_EDCE38FD] # **Chart Development Guide**
%[text] %[text:anchor:H_FB11F72E] ## Introduction
%[text] Developing advanced MATLAB visualizations often involves managing multiple low-level graphics objects. This is especially the case for applications containing graphics that update dynamically. Such applications may require time-consuming programming.
%[text] A chart object provides a high-level application programming interface (API) for creating custom visualizations. A chart not only provides a user-friendly and convenient visualization API for the end users; it also removes the need for the user to implement low-level graphics programming.
%[text] MATLAB provides an object-oriented framework for developing custom chart classes, via the following container superclasses:
%[text] %[text:anchor:06BFB676] - [`matlab.graphics.chartcontainer.ChartContainer`](<matlab: doc ChartContainer>) (available from R2019b), and
%[text] - [`matlab.ui.componentcontainer.ComponentContainer`](<matlab: doc ComponentContainer>) (available from R2020b). \
%[text] Using a scatter plot containing the best-fit line as the main example, this document describes design patterns and guidelines for custom chart implementation using this framework. Topics include:
%[text] - Writing a standard chart template
%[text] - Encapsulating the chart's data and graphics
%[text] - Writing the chart's `setup` and `update` methods
%[text] - Creating a high-level visualization API for the chart
%[text] - Including interactive controls within the chart \
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:H_F514727F] ## Existing chart examples
%[text] Several visualization functions which ship with MATLAB create charts. For example, the [`heatmap`](<matlab: doc heatmap>) chart visualizes matrix values overlaid on colored grid squares, and the [`geobubble`](<matlab: doc geobubble>) chart provides a quick way to plot discrete data points on a map.
%[text] ![](text:image:21e3)
%%
%[text] %[text:anchor:H_977E063C] ## Writing a standard chart template
%[text] Charts are implemented as MATLAB [classes](<matlab: web(fullfile(docroot, 'matlab/object-oriented-programming.html'))>). The first step when developing a chart is to create the chart's class definition file, using one of the two container superclasses mentioned [above](internal:06BFB676). The design patterns and guidelines described in this document are relevant to both container superclasses.
%[text] Deciding which superclass to use can be determined by the requirements of the chart. If the chart does **not** require any interactive user-facing controls (e.g., buttons, dropdown menus, or checkboxes) then we derive the chart from [`matlab.graphics.chartcontainer.ChartContainer`](<matlab: doc matlab.graphics.chartcontainer.ChartContainer>); otherwise, we derive the chart from [`matlab.ui.componentcontainer.ComponentContainer`](<matlab: doc matlab.ui.componentcontainer.ComponentContainer>).
%[text] Note that the chart container superclass provides a [`tiledlayout`](<matlab: doc tiledlayout>) as the top-level graphics object. A `tiledlayout` object accepts all types of axes to be added to the layout, but does not permit the addition of panels or user-interface controls.
%[text] On the other hand, the component container superclass provides a different top-level graphics object which allows the addition of all types of axes as well as panels and user-interface controls.
%%
%[text] %[text:anchor:H_D1C7680B] ## The `ScatterFitChart` chart template
%[text] Since `ScatterFitChart` is an interactive chart containing various controls, we derive it from the component container.
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text]     %SCATTERFITCHART Chart component managing 2D scattered data (x and y)
%[text]     %together with the corresponding best-fit line.
%[text] 
%[text] end % classdef
%[text] ```
%[text] This implementation already provides a number of useful features.
%[text] - The chart is a [`handle`](<matlab: doc handle>) class, which is consistent with other MATLAB graphics objects and means that the chart can be modified in place.
%[text] - The chart supports both the dot notation and the `get`/`set` syntax for properties.
%[text] - Chart objects are positioned naturally within the MATLAB graphics hierarchy. For example, if we parent the chart object to a figure, the chart is an element of the figure's `Children` property. \
%[text] %[text:anchor:H_0BF0F86C] #### Additional remarks
%[text] - The chart is a subclass of [`matlab.mixin.CustomDisplay`](<matlab: doc matlab.mixin.CustomDisplay>), so the chart author has the ability to customize the display behavior of the chart by providing implementations of the corresponding protected methods, such as `getHeader`, `getFooter`, `displayScalarObject` etc.
%[text] - The chart is a subclass of [`matlab.mixin.Heterogeneous`](<matlab: doc("matlab.mixin.Heterogeneous")>), so concatenating different types of charts to create a chart array is naturally supported. \
%%
%[text] %[text:anchor:H_258FBFE9] ## Inserting the `setup` and `update` methods
%[text] At this point, we cannot create an object from the `ScatterFitChart` class. Attempting to do so causes an error, because both the `ChartContainer` and `ComponentContainer` superclasses require the chart author to implement two special methods:
%[text] - [`setup`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.setup")>): this method is called automatically when the chart object is created.
%[text] - [`update`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.update")>): this method is called automatically when the chart user modifies certain properties of the chart object.  \
%[text] ```
%[text] >> SFC = ScatterFitChart();
%[text] Abstract classes cannot be instantiated.  Class 'ScatterFitChart' inherits abstract
%[text] methods or properties but does not implement them.  See the list of methods and
%[text] properties that 'ScatterFitChart' must implement if you do not intend the class to be
%[text] abstract.
%[text]  
%[text] 
%[text] Abstract methods for class ScatterFitChart:
%[text]     update	% defined in matlab.ui.componentcontainer.ComponentContainer
%[text]     setup 	% defined in matlab.ui.componentcontainer.ComponentContainer
%[text] ```
%[text] These methods are protected (and abstract) in both superclasses, so we also need to implement them as protected methods in any custom chart that we design. We will discuss the purpose and content of the `setup` and `update` methods in more detail later on. For the moment, let's provide stub implementations so that we are able to create a chart object.
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text]     %SCATTERFITCHART Chart component managing 2D scattered data (x and y)
%[text]     %together with the corresponding best-fit line.
%[text] 
%[text]     methods ( Access = protected )
%[text] 
%[text]         function setup( obj )
%[text] 
%[text]         end % setup
%[text] 
%[text]         function update( obj )
%[text] 
%[text]         end % update
%[text]    
%[text]     end % methods ( Access = protected )
%[text] 
%[text] end % classdef
%[text] ```
%[text] To create a chart object, we call the constructor method:
%[text] ```matlabCodeExample
%[text] SFC = ScatterFitChart();
%[text] ```
%[text] %[text:anchor:H_B4971240] #### Remarks
%[text] - The chart constructor accepts name-value pairs to allow its properties to be specified on construction, e.g.,  \
%[text] ```matlabCodeExample
%[text] f = uifigure();
%[text] SFC = ScatterFitChart( "Parent", f, "Visible", "off" );
%[text] ```
%[text] - The chart inherits various important properties, including [`Parent`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.Parent")>), [`Units`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.Units")>), [`Position`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.Position")>), [`Layout`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.Layout")>), [`HandleVisibility`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.HandleVisibility")>) and [`Visible`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.Visible")>). These allow the chart to be resized, hidden, shown, and moved within the graphics hierarchy. We can use the [`properties`](<matlab: doc("properties")>) command to obtain a complete list: \
%[text] ```matlabCodeExample
%[text] properties( SFC )
%[text] ```
%[text] %[text:anchor:H_9DEDB62A] #### Additional remarks
%[text] - We can also write a constructor method for our chart. One of the main reasons for doing this is to support more informal construction syntax, not involving the specification of name-value pairs.
%[text] - For example, we might choose to allow end users to create a `ScatterFitChart` chart using more informal graphics-like syntax as shown below. We would achieve this by writing the chart's constructor method and handling the various possibilities for the input arguments.
%[text] - Note that if we write the chart's constructor method, then the constructor is called first, followed by the chart's `setup` method, and finally by the chart's `update` method. \
%[text] ```matlabCodeExample
%[text] f = uifigure();
%[text] x = 1:10;
%[text] y = rand( size( x ) );
%[text] SFC = ScatterFitChart( f, x, y );
%[text] ```
%[text] 
%%
%[text] %[text:anchor:H_CF6E17E1] ## The chart's `setup` and `update` methods
%[text] All charts must provide implementations of the **`setup`** and **`update`** methods. This requirement is enforced by the chart's superclass. 
%[text] %[text:anchor:H_67AAF6D0] #### The `setup` method
%[text] - The `setup` method runs when the chart is being created. It is called from the superclass constructor.
%[text] - Typical responsibilities for the **`setup`** method include initializing and configuring the private, internal graphics and control objects maintained by the chart, as well as preparing the chart's visual layout and appearance.
%[text] - The **`setup`** method plays a similar role to the class constructor method. Like the constructor, it is called automatically when a chart object is created, so we should place any code intended to initialize object properties in the **`setup`** method. \
%[text] ```matlabCodeExample
%[text] function setup( obj )
%[text] %SETUP Initialize the chart graphics.
%[text] 
%[text] % Define the chart's layout and appearance.
%[text] 
%[text] % Create the chart's graphics objects.
%[text] 
%[text] % Create the chart's control objects.
%[text] 
%[text] end % setup
%[text] ```
%[text] %[text:anchor:H_2291E946] #### The **`update`** method
%[text] - The **`update`** method is called whenever an individual public interface property is modified by the chart user via the dot syntax, or once when the user calls the **`set`** function on the chart with a list of name-value pair arguments comprising public interface chart properties. In the latter situation, the chart passes through the **`set`** method for each property (if these exist) before invoking its `update` method. Note that the **`update`** method is only called once for each call to the `set` function.
%[text] - When writing the **`update`** method, it is important to distinguish between chart modifications that require (expensive) computation and those that only require (much cheaper) modification of decorative properties of the chart's graphics. This is easy to implement using an if statement to check the value of the internal property **`ComputationRequired`** which keeps track of whether a full update is required.
%[text] - We should always refresh the chart's decorative properties by mapping the high-level object properties to the corresponding low-level graphics objects properties. This can be done at the end of the **`update`** method, after the `if` statement used to determine whether a full update is needed. There is minimal overhead associated with this, even if the chart's decorative properties have not changed. \
%[text] ```matlabCodeExample
%[text] function update( obj )
%[text] %UPDATE Refresh the chart graphics.
%[text] 
%[text] % Check whether a full update is required.
%[text] if obj.ComputationRequired
%[text]                 
%[text] % Perform the corresponding updates and computations.
%[text] % ...
%[text] 
%[text]     % Mark the chart clean.
%[text]     obj.ComputationRequired = false();
%[text]                 
%[text] end % if
%[text]             
%[text] % Refresh the chart's decorative properties.
%[text] % ...
%[text]      
%[text] end % update
%[text] ```
%%
%[text] %[text:anchor:H_E0EEAC3F] ## The chart's data properties
%[text] One of the most important behavioral features of a chart is that its graphics objects should update automatically when its underlying data is modified by the user. 
%[text] We achieve this using the following steps.
%[text] 1. Define the underlying chart data as public properties of the chart class. This enables the chart users to access and modify the chart's data.
%[text] 2. Implement any associated changes to the chart's graphics objects within the [`update`](<matlab: doc("matlab.ui.componentcontainer.ComponentContainer.update")>) method. The **`update`** method is called automatically when the end user sets any of the chart's public properties. This is a feature of the chart and component development framework. \
%[text] %[text:anchor:H_08345BD0] #### Remarks
%[text] - The chart's data properties are part of the chart's public interface. The `update` method is not, and it is not possible for chart users to invoke the **`update`** method directly (it is a protected method).
%[text] - When one or more of the chart's data properties are changed, the chart may need to perform internal computations using the new data. This code could be computationally expensive. For example, certain types of chart may need to solve an optimization problem, or perform other potentially time-consuming operations. Since the chart's **`update`** method is called whenever any public property is set, including chart properties which are not data properties, we treat the chart's data properties separately in the **`update`** method. This avoids executing unnecessary code when other (non-data) chart properties are set by the end user. \
%[text] In the `ScatterFitChart`, the data properties are **`XData`** and **`YData`**. These allow the chart user to modify the $x$-data and $y$-data of the scatter plot separately (or set both properties together).
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text] 
%[text]     properties ( Dependent )
%[text]         % Chart x-data.
%[text]         XData(:, 1) double {mustBeReal}
%[text]         % Chart y-data.
%[text]         YData(:, 1) double {mustBeReal}
%[text]     end % properties ( Dependent )
%[text] 
%[text] end % classdef
%[text] ```
%[text] We implement as much validation as possible for each data property within this properties block. In this example, both **`XData`** and **`YData`** should be real column vectors of type [`double`](<matlab: doc("double")>). MATLAB performs the property validation in the following order:
%[text] - Data type (e.g., **`double`**); note that values convertible to the specified data type will be converted automatically.
%[text] - Size (e.g., `(:, 1)`); note that compatible shapes will be converted to the specified size (e.g., a row vector will be converted to a column vector).
%[text] - Validation functions listed in curly braces `{}`, evaluated from left to right. \
%[text] For more information, see [Validate Property Values](<matlab: web(fullfile(docroot, "matlab/matlab_oop/validate-property-values.html"))>) in the documentation.
%[text] In this example, which is typical, we use the **`Dependent`** attribute for the data properties. In many cases the chart's data properties depend on each other. A common situation is that the data properties should have the same length. 
%[text] Dependent properties are not stored properties, but rather their values are computed on-the-fly using a special method known as a get method, which has a standard syntax.
%[text] ```matlabCodeExample
%[text] function value = get.XData( obj )
%[text] 
%[text] end % get.XData
%[text] ```
%[text] Each dependent property in the class must have a corresponding get method in order to define its value. If we also require the property to be modified by the end user, then we also need to write a corresponding set method for the property. Set methods are invoked automatically whenever the end user modifies the property value. Set methods are also implemented using a standard syntax.
%[text] ```matlabCodeExample
%[text] function set.XData( obj, value )
%[text] 
%[text] end % set.XData
%[text] ```
%[text] For more information, see [Set and Get Methods for Dependent Properties](<matlab: web(fullfile(docroot, "matlab/matlab_oop/access-methods-for-dependent-properties.html"))>) in the documentation. Implementing property validation for each data property within the properties block simplifies their corresponding **`set`** methods. We'll discuss the chart's get and set methods in more detail later on.
%[text] Occasionally we need to set a default value for the chart's dependent data properties. This is because certain combinations of property validation functions require a default value to be set, otherwise, an error occurs when creating the object. For example, the [`mustBeNonempty`](<matlab: doc mustBeNonempty>) validation function requires a nonempty default value to be set for the corresponding property.
%%
%[text] %[text:anchor:H_182E106A] ## The chart's decorative properties
%[text] Next, we focus on the remaining parts of the chart's public API. To make the chart easy to customize, we can provide public, user-settable properties which are mapped onto the chart's internal private graphics objects.
%[text] First, we can define the decorative, stylistic chart properties, such as colors, line widths, markers, etc. When these are changed, the chart does not need to perform any computation, but rather should modify the corresponding properties of its internal graphics objects.
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text] 
%[text]     properties
%[text]         % Size data for the scatter series.
%[text]         SizeData = 36
%[text]         % Color data for the scatter series.
%[text]         CData = [0, 0.4470, 0.7410]
%[text]     end % properties
%[text] 
%[text] end % classdef
%[text] ```
%[text] The code for modifying the properties of the internal graphics objects can be implemented in the chart's **`update`** method.
%[text] %[text:anchor:H_B464F28C] #### Remarks
%[text] - Note that these properties should be assigned default values, because the chart's **`update`** method is invoked automatically after the chart object is constructed. If no default value is provided, then the **`update`** method will error when attempting to set the properties on the internal graphics objects.
%[text] - We choose not to put any property validation here, because the chart's underlying graphics objects implement their own property validation. \
%%
%[text] %[text:anchor:H_56DE015B] ## The chart's dependent decorative properties
%[text] Next, we define a properties block containing the chart's dependent decorative properties. These are part of the chart's public API and are similar to the decorative properties discussed above. 
%[text] Any decorative properties which are associated with the chart's user-facing controls will fall into this category. 
%[text] For example, if the chart has a control to allow the user to select the marker of a line, then the corresponding chart property will be dependent. If the user programmatically sets the marker, then the **`set`** method for the property will need to update the control to display the correct marker. If the **`set`** method for a property `X` needs to access another property, then the property `X` needs to be dependent.
%[text] If the chart can be modified by the user programmatically or interactively, then it is essential that the chart's graphics objects are kept synchronized. As a general principle, anything that can be done from the chart's graphical interface should also be doable programmatically. A good example, common to many charts, is using a toggle button to hide or show the chart's control panel (if the chart has one).
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text]        
%[text]     properties ( Dependent )        
%[text]         % Visibility of the best-fit line.
%[text]         LineVisible(1, 1) matlab.lang.OnOffSwitchState
%[text]         % Width of the best-fit line.
%[text]         LineWidth(1, 1) double {mustBePositive, mustBeFinite}
%[text]         % Style of the best-fit line.
%[text]         LineStyle(1, 1) string {mustBeLineStyle}
%[text]         % Scatter series marker.
%[text]         Marker(1, 1) string {mustBeMarker}
%[text]         % Color of the best-fit line.
%[text]         LineColor
%[text]         % Axes x-grid.
%[text]         XGrid(1, 1) matlab.lang.OnOffSwitchState
%[text]         % Axes y-grid.
%[text]         YGrid(1, 1) matlab.lang.OnOffSwitchState
%[text]         % Visibility of the chart controls.
%[text]         Controls(1, 1) matlab.lang.OnOffSwitchState
%[text]     end % properties ( Dependent )
%[text] 
%[text] end % classdef
%[text] ```
%[text] %[text:anchor:H_8F75C899] #### Remarks
%[text] - Since these properties have public set access, it is good practice to add property validation. \
%%
%[text] %[text:anchor:H_85C0B00F] ## The chart's private properties
%[text] Next, we define the private, stored data properties maintained by the chart.
%[text] These properties include:
%[text] - Internal storage for the chart's public data interface properties. By convention, we name these using an underscore at the end of the property name, e.g., `XData_` is the internal stored property corresponding to the public interface property `XData`.
%[text] - Any other internal items of data which require storage can be defined here. This includes the logical scalar property `ComputationRequired` to keep track of whether a full, potentially computationally expensive chart update is required, or whether only a cheaper, faster graphics update is required. \
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer       
%[text]     
%[text]     properties ( Access = private )
%[text]         % Internal storage for the XData property.
%[text]         XData_(:, 1) double {mustBeReal} = double.empty( 0, 1 )
%[text]         % Internal storage for the YData property.
%[text]         YData_(:, 1) double {mustBeReal} = double.empty( 0, 1 )
%[text]         % Logical scalar specifying whether a computation is required.
%[text]         ComputationRequired(1, 1) logical = false
%[text]     end % properties ( Access = private )
%[text] 
%[text] end % classdef
%[text] ```
%[text] %[text:anchor:H_B35ED514] #### Remarks
%[text] - These properties are only ever modified by internal code. Property validation guards against internal (developer) errors.
%[text] - We assign default values for these properties according to their data type and size. The public static method [`empty`](<matlab: doc empty>) is useful here for initializing property values. Every data type in MATLAB has this method (including user-defined types). \
%%
%[text] %[text:anchor:H_F1852851] ## The chart's graphics objects
%[text] Charts are responsible for maintaining their graphics objects, which should not be exposed directly to the end user. Encapsulating the graphics objects in the chart prevents unauthorized access, modification and deletion.
%[text] The chart's graphics objects should be stored as private properties. Each property stores a reference to a different graphics object maintained by the chart.
%[text] It's good practice to use the `Transient` and `NonCopyable` [property attributes](<matlab: web(fullfile(docroot, 'matlab/matlab_oop/property-attributes.html'))>) in this block, to ensure correct chart behavior when users save, load and copy chart objects.
%[text] - `Transient` properties are not saved when the chart object is saved to disk. This prevents duplicate graphics objects from being created when the user loads a chart object.
%[text] - `NonCopyable` properties are not copied when the user creates a (deep) copy of the chart object. This prevents two chart objects from referencing the same underyling graphics objects. \
%[text] %[text:anchor:H_596809FF] #### Remarks
%[text] - It is helpful to implement property validation in this block because it enables tab completion for properties of these graphics objects when writing code in subsequent chart methods.
%[text] - We validate that these properties are either empty or scalar-valued. When the class is initialized, the properties will be assigned an empty initial value by MATLAB before the onscreen graphics object is created in the **`setup`** method. \
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text]     
%[text]     properties ( Access = private, Transient, NonCopyable )
%[text]         % Chart layout.
%[text]         LayoutGrid(:, 1) matlab.ui.container.GridLayout {mustBeScalarOrEmpty}
%[text]         % Chart axes.
%[text]         Axes(:, 1) matlab.graphics.axis.Axes {mustBeScalarOrEmpty}
%[text]         % Toggle button for the chart controls.
%[text]         ToggleButton(:, 1) matlab.ui.controls.ToolbarStateButton {mustBeScalarOrEmpty}
%[text]         % Scatter series for the (x, y) data.
%[text]         ScatterSeries(:, 1) matlab.graphics.chart.primitive.Scatter {mustBeScalarOrEmpty}
%[text]         % Line object for the best-fit line.
%[text]         BestFitLine(:, 1) matlab.graphics.primitive.Line {mustBeScalarOrEmpty}
%[text]         % Label to display a summary of the best-fit line statistics.
%[text]         SummaryLabel(:, 1) matlab.ui.control.Label {mustBeScalarOrEmpty}
%[text]         % Check box for the best-fit line visibility.
%[text]         BestFitLineCheckBox(:, 1) matlab.ui.control.CheckBox {mustBeScalarOrEmpty}
%[text]         % Spinner for selecting the width of the best-fit line.
%[text]         LineWidthSpinner(:, 1) matlab.ui.control.Spinner {mustBeScalarOrEmpty}
%[text]         % Dropdown menu for selecting the style of the best-fit line.
%[text]         LineStyleDropDown(:, 1) matlab.ui.control.DropDown {mustBeScalarOrEmpty}
%[text]         % Dropdown menu for selecting the marker of the scatter plot.
%[text]         MarkerDropDown(:, 1) matlab.ui.control.DropDown {mustBeScalarOrEmpty}
%[text]         % Pushbutton for selecting the color of the best-fit line.
%[text]         LineColorButton(:, 1) matlab.ui.control.Button {mustBeScalarOrEmpty}
%[text]         % Check box for the axes' XGrid visibility.
%[text]         XGridCheckBox(:, 1) matlab.ui.control.CheckBox {mustBeScalarOrEmpty}
%[text]         % Check box for the axes' YGrid visibility.
%[text]         YGridCheckBox(:, 1) matlab.ui.control.CheckBox {mustBeScalarOrEmpty}
%[text]     end % properties ( Access = private, Transient, NonCopyable )
%[text] 
%[text] end % classdef
%[text] ```
%[text] 
%%
%[text] %[text:anchor:H_753B3C76] ## Other chart properties
%[text] Charts, in common with other user-defined classes, may define other property blocks equipped with general sets of attributes as required by the specific implementation.
%[text] %[text:anchor:H_C59ED884] #### Note on the toolbox charts
%[text] Example charts in the toolbox define their product dependencies using a constant, hidden property. This property is used by the chart browser, which only shows charts available to the user based on their installed toolboxes. This block is not required for user-authored charts.
%%
%[text] %[text:anchor:H_8762D352] ## Get and set methods
%[text] Any dependent chart property requires a corresponding `get` method to compute its value when required. Similarly, `set` methods are required for dependent properties if these are permitted to be modified by the chart user. A common situation is to have chart data properties which are mutually dependent, e.g., `XData` and `YData` properties which must be synchronized to have the same length.
%[text] %[text:anchor:H_BC9868F2] #### Setting the `ComputationRequired` chart property
%[text] If we are working with one of the chart's data properties, then when the property is changed by the user we need to refresh some or all of the chart's graphics objects, which is a potentially time-consuming and computationally expensive process. To indicate that a full chart update is required when the property is set, we set the auxiliary internal property `ComputationRequired` (a logical scalar value) to have value `true`.
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text] 
%[text] methods
%[text] 
%[text]     function set.XData( obj, value )
%[text] 
%[text]         % Mark the chart for an update.
%[text]         obj.ComputationRequired = true;
%[text] 
%[text]     end % set.XData
%[text] 
%[text] end % methods
%[text] 
%[text] end % classdef
%[text] ```
%[text] This programming pattern works because MATLAB will call the `set` method for the property before invoking the chart's `update` method, so the logical flag `ComputationRequired` will be up-to-date when its value is checked in the `update` method. 
%[text] After performing the required calculations and graphics updates, the `update` method should reset the `ComputationRequired` property to `false`.
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text] 
%[text]     methods ( Access = protected )
%[text] 
%[text]         function update( obj )
%[text]         %UPDATE Refresh the chart graphics.
%[text]     
%[text]         if obj.ComputationRequired
%[text]         % Potentially time-consuming code goes here.
%[text]         % ...
%[text]         % ...
%[text] 
%[text]         % Mark the chart clean.
%[text]         obj.ComputationRequired = false;
%[text] 
%[text]         end % if
%[text] 
%[text]         end % update
%[text] 
%[text]     end % methods
%[text] 
%[text] end % classdef
%[text] ```
%[text] %[text:anchor:H_10B61692] #### Supporting length changes in the chart's data properties
%[text] Standard MATLAB graphics such as `Line` and `Scatter` objects issue a warning, and do not perform a graphics refresh, if one of their data properties (e.g., `XData`) is set to a new value with a different length to the current value. This behavior can be awkward if we intend to update the other data property (e.g., `YData`) in a subsequent operation. User-defined charts can bypass this problem by allowing their data properties to be set independently to take on new values of arbitrary length. A common way to do this is to intercept the user-specified value and either pad or truncate the other data property so as to match up the lengths. For example, in the `ScatterFitChart`, we support arbitrary length changes as follows.
%[text] - Check the length of the proposed `XData` vector.
%[text] - If the new `XData` is too short, then we truncate the chart's `YData` property (stored internally in `YData_`).
%[text] - If the new `XData` is too long, then we pad the chart's `YData` property.
%[text] - In both cases, setting the chart's `XData` also triggers a change in the internal, stored `YData_` property.
%[text] - The set method for the `YData` property is similar, and changes the `XData_` property as appropriate. \
%[text] ```matlabCodeExample
%[text] classdef ScatterFitChart < matlab.ui.componentcontainer.ComponentContainer
%[text] 
%[text] methods
%[text] 
%[text]     function set.XData( obj, value )
%[text] 
%[text]         % Mark the chart for an update.
%[text]         obj.ComputationRequired = true();
%[text] 
%[text]         % Decide how to modify the chart data.
%[text]         nX = numel( value );
%[text]         nY = numel( obj.YData_ );
%[text]             
%[text]         if nX < nY % If the new x-data is too short ...
%[text]             % ... then chop the chart y-data.
%[text]             obj.YData_ = obj.YData_(1:nX);
%[text]         else
%[text]             % Otherwise, if nX >= nY, then pad the y-data.
%[text]             obj.YData_(end+1:nX, 1) = NaN;
%[text]         end % if
%[text]             
%[text]         % Set the internal x-data.
%[text]         obj.XData_ = value;
%[text] 
%[text]     end % set.XData
%[text] 
%[text] end % methods
%[text] 
%[text] end % classdef
%[text] ```
%[text] %[text:anchor:H_B7C0234C] #### Set methods for the dependent, decorative properties
%[text] These chart properties are dependent because when they are set programmatically by the end user, one or more of the chart's internal graphics objects needs to be updated, usually a user-facing control object. The user can change the property either programmatically, or interactively by manipulating the control object.
%[text] For example, the `ScatterFitChart` has a dependent, decorative property `LineVisible` which controls the visibility of the best-fit line object `BestFitLine` maintained by the chart. The chart also has an internal property `BestFitLineCheckBox` which is a reference to the `uicheckbox` in the chart's control panel. The `get` and `set` methods for the `LineVisible` property are as follows. Note that the `set` method updates both the `BestFitLine` and the `BestFitLineCheckBox` chart properties.
%[text] ```matlabCodeExample
%[text] function value = get.LineVisible( obj )
%[text]             
%[text]     value = obj.BestFitLine.Visible;
%[text]             
%[text] end % get.LineVisible
%[text]         
%[text] function set.LineVisible( obj, value )
%[text]           
%[text]     % Update the property.
%[text]     obj.BestFitLine.Visible = value;
%[text]     
%[text]     % Update the check box.
%[text]     obj.BestFitLineCheckBox.Value = value;
%[text]             
%[text]  end % set.LineVisible
%[text] ```
%[text] 
%%
%[text] %[text:anchor:H_91A196FF] ## Annotation methods
%[text] To provide a convenient and familiar user interface, charts can define their own annotation methods whenever appropriate. Annotation methods should have the same name as (i.e., should *overload*) the corresponding high-level graphics decoration function, e.g., `xlabel`, `title` or `grid`.
%[text] Methods in this category include:
%[text] - [`xlabel`](<matlab: doc("xlabel")>), [`ylabel`](<matlab: doc("ylabel")>), [`zlabel`](<matlab: doc("zlabel")>)
%[text] - [`title`](<matlab: doc("title")>)
%[text] - [`grid`](<matlab: doc("grid")>)
%[text] - [`legend`](<matlab: doc("legend")>)
%[text] - [`alpha`](<matlab: doc("alpha")>)
%[text] - [`axis`](<matlab: doc("axis")>)
%[text] - x/y/[`zticks`](<matlab: doc("zticks")>), x/y/[`zticklabels`](<matlab: doc("zticklabels")>), x/y/[`ztickangle`](<matlab: doc("ztickangle")>), x/y/[`ztickformat`](<matlab: doc("ztickformat")>) \
%[text] To call these methods, the user should provide a reference to the chart as the first input argument, followed by any subsequent input arguments. (In fact, if the chart is derived from `matlab.graphics.chartcontainer.ChartContainer`, the first input argument can be omitted, because such charts are detected by the [`gca`](<matlab: doc("gca")>) function (this returns the current axes or chart). However, since charts could also be derived from `matlab.ui.componentcontainer.ComponentContainer`, it is good practice to specify the chart as the first input argument when calling an annotation method.
%[text] ```matlabCodeExample
%[text] xlabel( SFC, "x-data" )
%[text] ```
%[text] If the particular annotation method supports outputs, then it can be called with an output argument to return a reference to the underlying graphics object for further customization. For example, the [`xlabel`](<matlab: doc("xlabel")>) function usually returns a text object.
%[text] ```matlabCodeExample
%[text] xl = xlabel( SFC, "x-data" );
%[text] ```
%[text] %[text:anchor:H_CAD1DA05] #### Remarks
%[text] - In most cases, the overloaded annotation method will invoke its namesake on the chart's axes, passing any user-specified input arguments directly to the namesake.
%[text] - The convenience of supporting output arguments outweighs the potential encapsulation breach which occurs if the user queries the method output to obtain a reference to one of the chart's underlying private graphics objects. For example, the `Parent` property of the text object returned by `xlabel` is the underlying axes object, which the user could then manipulate or even delete. However, the benefit is that the chart's axes' x-label can be completely customized, without the need to laboriously define many separate decorative chart properties (e.g., `XLabelFontSize`, `XLabelFontWeight`, ...).
%[text] - To support name-value pairs and output arguments, it is convenient to use [`varargin`](<matlab: doc("varargin")>) and [`varargout`](<matlab: doc("varargout")>) when overloading the annotation methods. Both `varargin` and `varargout` are cell arrays, so we use curly braces `{}` to access their contents. The syntax `varargin{:}` produces a comma-separated list of the contents of the cell array `varargin`. To determine the number of output arguments requested by the end user, we use [`nargout`](<matlab: doc("nargout")>). Placing a variable number of output arguments into the cells of the array `varargout` can be done using the syntax `[varargout{1:nargout}]`.
%[text] - Calling an annotation method on a chart should, if applicable, result in the corresponding changes being made to the chart's decorative properties. For example, the chart might support both the `grid` method as well as the `XGrid` and `YGrid` decorative properties. Invoking `grid` on the chart should update the `XGrid` and `YGrid` properties as appropriate. The same applies to any of the chart's control objects which need to be synchronized with the annotation methods. \
%[text] %[text:anchor:H_20A3325D] #### Examples
%[text] - Here is the `xlabel` annotation method for the `ScatterFitChart`. \
%[text] ```matlabCodeExample
%[text] function varargout = xlabel( obj, varargin )
%[text]             
%[text]     [varargout{1:nargout}] = xlabel( obj.Axes, varargin{:} );
%[text]             
%[text]  end % xlabel
%[text] ```
%[text] - Here is the `grid` annotation method for the `ScatterFitChart`. Note that `grid` does not return any output argument, and that after `grid` is called on the chart's underlying axes, the chart's decorative properties `XGrid` and `YGrid` need to be updated. \
%[text] ```matlabCodeExample
%[text] function grid( obj, varargin )
%[text]             
%[text]     % Invoke grid on the axes.
%[text]     grid( obj.Axes, varargin{:} )
%[text]     
%[text]     % Ensure the controls are up-to-date. This can be done by
%[text]     % setting the XGrid/YGrid chart properties, which in turn will
%[text]     % refresh the controls.
%[text]     obj.XGrid = obj.Axes.XGrid;
%[text]     obj.YGrid = obj.Axes.YGrid;
%[text]             
%[text] end % grid
%[text] ```
%[text] %[text:anchor:H_D556FA8B] ## 
%%
%[text] %[text:anchor:H_562C8142] ## Private methods and local functions
%[text] Charts, in common with other user-defined classes, may define private methods or local functions for internal computations. Callback functions corresponding to user-facing chart controls should be implemented as private methods within the chart class.
%%
%[text] %[text:anchor:H_750BDD5E] ## Integrating charts with interactive applications
%[text] One of the benefits of authoring a specialized chart is that it can be reused in different contexts. Many applications will simply use charts in scripts and functions to create standalone visualizations. On the other hand, charts can be integrated with interactive applications. This applies both to applications created using App Designer as well as those created programmatically.
%[text] We can include a chart in an app created with App Designer as follows.
%[text] - Open the existing app in App Designer (or create a new app).
%[text] - Add a new private property to the app, e.g., `Chart`, to represent the chart. \
%[text] ```matlabCodeExample
%[text] classdef AppWithChart < matlab.apps.AppBase
%[text] 
%[text] properties (Access = private)
%[text]     % Chart maintained by the app.
%[text]     Chart(:, 1) ScatterFitChart {mustBeScalarOrEmpty}
%[text] end % properties ( Access = private )
%[text] 
%[text] end % classdef
%[text] ```
%[text] - Equip the app with a [startup function](<matlab: web(fullfile(docroot, "matlab/creating_guis/app-designer-startup-function.html"))>). Within the app's startup function, create the chart and assign it to the app property above. The chart will be parented to one of the graphics objects within the app, for example, a tab, panel, grid layout or the app's main figure itself. \
%[text] ```matlabCodeExample
%[text] function onStartup( app )
%[text] 
%[text] % Create and store the chart object.
%[text] app.Chart = ScatterFitChart( "Parent", app.Figure );
%[text] 
%[text] end % onStartup
%[text] ```
